testRunner.testCase.setPropertyValue("payorID", payorID)
log.info "payorID : $payorID"

def String getProcCdsInSystemStSettings(int SystemSettingId) throws Exception {
	def ss = systemDao.getSystemSateSetting(SystemSettingId);
	log.info "Data value: " + ss.getDataValue();
	def procCds = "('" + ss.getDataValue().replace(",", "','") + "')";

	return procCds;
}
